작은 기사 식당의 요리사였던 나는 황제도 두려워하는 권력가의 천덕꾸러기 막내딸이 되었다. 
여비를 모아서 도망치려고 했는데……. 

이상하다. 

&#34;네게 미안하다고 하면 염치가 없는 건가.&#34;
&#34;그야 내가 네 오빠니까.&#34;
&#34;할애비와 산책해 주지 않는 거냐.&#34;

다들 갑자기 왜 잘해 주는 거지? 

&#34;너를 보는 놈들의 눈알을 죄 뽑아 버리고 싶은 건 왜일까요.&#34;

도망치려는 나와 붙잡는 사람들.
요리만 했을 뿐인데 왜 이러는 거람…….

[그녀가 예뻐 죽는 가족들 / 도망치고 싶은 그녀 / 여주 한정 머슴들의 등장]

고백했다.
맨 정신으로 하기엔 자신이 없어서 딱 한 잔만 걸치고.

&#34;좋아해요.&#34;
&#34;......왜?&#34;
&#34;...그냥, 모든 게 좋아요.&#34;
&#34;......이해가, 되지 않는데.&#34;

뭔가 이상했다.
목소리가 낮았고, 키도 조금 달랐고, 체형도 꽤 달랐다.
심지어 이제야 보이는, 달빛에 비치는 머리칼의 색 조차.

......이런 미친. 다른 사람이잖아.
그것도 죽음의 전장귀라고 불리는 카베르 윌라드 공작.



&#34;카베르.&#34;
&#34;......네?&#34;
&#34;앞으로 이상한 칭호 붙이지 말고, 이름으로 불러라.&#34;

언제나 딱딱하게 굳어있던 그의 입매가 끝내 미소를 그려 냈다.
내가 잘못 고백했단 걸 들키면 당장에 죽여버릴 것처럼.

손꼽아 기다리던 발렌타인데이.
다정은 2년 동안 짝사랑했던 회사 동료, 현우에게 고백하기로 결심한다. 

직접 만든 초콜릿과 함께 마음을 전하는 다정.

&#34;저와 사귀어 주세요!&#34;

&#34;좋습니다.&#34; 

어라...? 이 목소리는 현우 씨가 아닌 것 같은데?!
목소리의 주인은 완벽한 외모와 스펙, 철벽까지 갖춘...

&#34;지, 지도훈 팀장님?!&#34;

&#34;하지만 난 비밀 연애는 싫습니다. 이왕이면 우리, 대놓고 연애하죠.&#34;

&#34;네에?!&#34;

오해로 시작된 두 사람의
초콜릿처럼 달콤쌉싸름한 기간 한정 로맨스.


&#35;사내연애 &#35;계약연애 &#35;오피스물 &#35;로맥틱코미디 &#35;심쿵주의 &#35;철벽남

F급 말단 헌터 ‘김공자‘.
랭킹 1위 ‘염제‘를 부러워하던 어느 날, 무려 S+급 스킬을 얻는다.
하지만 기쁨도 잠시, 어째 스킬 내용이 이상하다?!

상대의 스킬 중 1개를 복사한다,까지는 좋은데…

&#34;뭐? 내가 죽어야만 발동된다고?!&#34;

죽어야 사는 헌터의 인간찬가 &lt;SSS급 죽어야 사는 헌터&gt;

간식으로 나온 빵을 오물거리던 열 세살의 어느날, 
달리아 페스테로즈는 문득 자신의 전생을 기억해낸다. 

이곳은 주인공들이 미쳐가는 피폐 여성향 게임 속 세상이고, 
자신은 장차 최고 악당의 여동생으로 태어났다는 것을! 
이대로라면 답도 없다. 가문은 멸문할거고, 나도 덤으로 쓱싹 되겠지. 

그러니 무조건, 가능한 한 빨리 이 가문에서 달아나야 한다! 
&#39;이렇게 된 이상 경계심을 낮춰 도망쳐야겠어!&#39; 

그렇게 가문을 노리는 친척과 능구렁이 같은 황제 등등을 걷어내고 
오빠의 환심을 듬뿍 산 것까지는 좋았는데- 

&#34;내가 달리아와 춤을 추고 싶은데. 뭐가 문제지?&#34; 
&#34;미안하지만, 내 동생이 낯을 가려서.&#34; 
&#34;달리아는 제가 제일 좋다고 했어요!&#34; 
어쩐지, 오빠를 너무 길들인 것도 모자라 이 세계 최강자들이 모두 나에게 집착한다!

한 남자가 제 모든 것을 걸고 만든,
단 한 번의 기적.

&#34;그대를 잃고 싶지 않아.&#34;
&#34;제발 내가 그대를 잃지 않게 해 줘.&#34;

신이 아니었다.

&#39;……당신, 이었어.&#39;
&#34;……백기하.&#34;

바람을 타고 노래처럼 날아드는 빛,
주위에서 별처럼 하얗게 부서져 내리는,
찬란한 기적.

신께 감사를 드렸건만,
이 기회를 제게 준 것은 그녀를 외면하던 신이 아니었다.

그녀에게 구애하고,
그녀가 모른 척하던 한 사람이었다.

&#39;그러지 마. 난 당신을 신경 쓸 겨를 없어.&#39;
&#39;내 가족을 살리는 게 무엇보다 먼저야. 그 외엔 아무것도 신경 쓰지 않을 거야.&#39;

그녀, 주세화는 자신과 가족을 모두 참살한 원수에게는 고통을,
자신을 위해 모든 것을 바친 그에게는 사랑을 답할 수 있을까.

황제에 의해 본질마저 부서진 채
제국을 위한 살아있는 검이 됐었던,
샤를리즈 로넌.

&#34;저는 저주받은 마검이 아닙니다.&#34;
&#34;저는 사람입니다!!&#34;

철저하고 완벽한 복수를 위해
제국을 지배하게 될 미래의 실세,
딜런을 길들이기 시작하는데…

&#34;황자님, 언제까지 그렇게 살 생각이세요?&#34;

&#34;스승님이 저를 바라보는 것 이상으로,&#34;
&#34;저는 스승님을 의아하게 바라보고 있습니다.&#34;

제 삶을 대가로 번영했던 제국의 멸망,
샤를은 바라는 것을 이룰 수 있을까.

동창생 이강민 때문에 남자와 제대로 된 연애도 못 하는 처녀이자 베이글녀인 고봉순!
14년 전, 자신을 &#39;꼬봉이&#39;로 만들었던 트라우마같은 놈 강민이를 동창회에서 만난다!
이제 복수가 하고 싶어 안달이 났는데, 잘나가는 대기업 전무인 그의 수행비서가 되어 다시 꼬봉이 신세로 전락하고.
이번엔 기필코 원수를 갚으리라, 복수의 칼날을 갈고 있는데……어라?!
이 깡패가 은밀한 유혹을 걸어온다?

&#34;나랑 한 번 하자.&#34;
&#34;뭘?&#34;

악연도 인연이었는지, 이끌린다.
처음엔 몸이, 그리고 마음이.


